import React, { FC, PropsWithChildren } from 'react';
import Link from 'next/link';
import { Menu } from 'antd';

export const AppLayout: FC<PropsWithChildren> = ({ children }) => {
  return (
    <div>
      <Menu mode='horizontal'>
        <Menu.Item>
          <Link href={'/'}>
            <a>Home</a>
          </Link>
        </Menu.Item>
        <Menu.Item>
          <Link href={'/profile'}>
            <a>Profile</a>
          </Link>
        </Menu.Item>
        <Menu.Item>
          <Link href={'/signup'}>
            <a>Signup</a>
          </Link>
        </Menu.Item>
      </Menu>
      {children}
    </div>
  );
};
